import React, { Component } from "react";
import Counter from "./counter";

export default class Counteres extends Component {
  state = {
    counters: [
      { id: 1, value: 5 },
      { id: 2, value: 6 },
      { id: 3, value: 0 },
      { id: 4, value: 0 },
      { id: 5, value: 0 },
    ],
  };
  render() {
    return (
      <React.Fragment>
          {this.state.counters.map(counter => <Counter key={counter.id}/>)}
      </React.Fragment>
    );
  }
}
